   // 付费信息\n    &-price {\n        .wuji-font-one-line(T_X04);\n        .wuji-font-weight(F_X03);\n        .wuji-color(CAM_X370);\n\n        &-wrap {\n            .wuji-mt(M_H_X003);\n            .wuji-pb(M_H_X001);\n            font-size: 0;\n        }\n\n        &-origin {\n            .wuji-ml(M_W_X005);\n            .wuji-font-one-line(T_X08);\n            .wuji-color(CAM_X793);\n            text-decoration: line-through;\n            vertical-align: 1px;\n        }\n    }\n\n    .@{widget-cls} {\n        .wuji-mt(M_H_X003);\n    }\n}\n","/**\n * @file spacing mixins\n * @author baozhixin <baozhixin@baidu.com>\n *\n * wuji-mx/wuji-my/wuji-px/wuji-py 没有先赋值一个变量的原因参考 plugin-less 文件 TIPS 说明\n */\n\n// 外边距\n.wuji-margin(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 上边距\n.wuji-margin-top(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-top: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-mt(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-margin-top(@code, @dpr, @unit);\n}\n\n// 右边距\n.wuji-margin-right(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-mr(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-margin-right(@code, @dpr, @unit);\n}\n\n// 下边距\n.wuji-margin-bottom(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-mb(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-margin-bottom(@code, @dpr, @unit);\n}\n\n// 左边距\n.wuji-margin-left(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-left: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-ml(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-margin-left(@code, @dpr, @unit);\n}\n\n// 左右边距\n.wuji-mx(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-left: addUnit(getSpacing(@code), @dpr, @unit);\n    margin-right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 上下边距\n.wuji-my(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-top: addUnit(getSpacing(@code), @dpr, @unit);\n    margin-bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 内填充\n.wuji-padding(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 上填充\n.wuji-padding-top(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-top: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-pt(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-padding-top(@code, @dpr, @unit);\n}\n\n// 右填充\n.wuji-padding-right(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-pr(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-padding-right(@code, @dpr, @unit);\n}\n\n// 下填充\n.wuji-padding-bottom(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-pb(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-padding-bottom(@code, @dpr, @unit);\n}\n\n// 左填充\n.wuji-padding-left(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-left: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-pl(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-padding-left(@code, @dpr, @unit);\n}\n\n// 左右填充\n.wuji-px(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-left: addUnit(getSpacing(@code), @dpr, @unit);\n    padding-right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 上下填充\n.wuji-py(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-top: addUnit(getSpacing(@code), @dpr, @unit);\n    padding-bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 绝对/相对定位-上偏移\n.wuji-top(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    top: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 绝对/相对定位-右偏移\n.wuji-right(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 绝对/相对定位-下偏移\n.wuji-bottom(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 绝对/相对定位-左偏移\n.wuji-left(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    left: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 水平和垂直方向平移\n.wuji-translate(@code-x: undefined, @code-y: undefined, @dpr: @dpr, @unit: @unit) {\n    transform: translate(addUnit(getSpacing(@code-x), @dpr, @unit), addUnit(getSpacing(@code-y), @dpr, @unit));\n}\n\n// 水平方向平移\n.wuji-translate-x(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    transform: translateX(addUnit(getSpacing(@code), @dpr, @unit));\n}\n.wuji-trans-x(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-translate-x(@code, @dpr, @unit);\n}\n\n// 垂直方向平移\n.wuji-translate-y(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    transform: translateY(addUnit(getSpacing(@code), @dpr, @unit));\n}\n.wuji-trans-y(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-translate-y(@code, @dpr, @unit);\n}\n","/**\n * @file color mixins\n * @author wuji.baidu-int.com\n *\n * 区别于color、background-color、border-color等受全局dark-mode和night-mode变量影响。\n * fill属性可以定义局部变量night-mode，这在关闭夜间模式情况下，可以单独保留svg填充颜色fill属性。\n * 究其原因：百度APP安卓夜间模式下，基本的颜色属性不能通过css定义生效，svg的颜色属性例外。建议自行测试验证和理解。\n */\n\n// TODO: 使用css变量\n// .use-cssvar() {}\n\n// mixin: 生成背景颜色\n.wuji-background-color(@code: undefined) {\n    @color-default: getColor(@code);\n    background-color: @color-default;\n\n    & when (@multi-mode = true) and (@dark-mode = true) {\n        @color-dark: getColor(@code, dark);\n\n        & when (@force-dark-output = true), not (@color-dark = 'null') and not (@color-dark = @color-default) {\n            @{selector-dark} & {\n                background-color: @color-dark;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and (@night-mode = true) {\n        @color-night: getColor(@code, night);\n\n        & when not (@color-night = 'null') and not (@color-night = @color-default) {\n            @{selector-night} & {\n                background-color: @color-night;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and not (@selector-default = '') {\n        @{selector-default} & {\n            background-color: @color-default;\n        }\n    }\n}\n\n// mixin: 添加区分模式的背景图片(可置于全局mixin中)\n.wuji-background-image(@src: null, @src-dark: null, @src-night: null) {\n    & when not (@src = null) {\n        background-image: url(@src);\n    }\n    & when (@multi-mode = true) {\n        & when not (@src-dark = null) and (@dark-mode = true) and not (@src = @src-dark) {\n            @{selector-dark} & {\n                background-image: url(@src-dark);\n            }\n        }\n        & when not (@src-night = null) and (@night-mode = true) and not (@src = @src-night) {\n            @{selector-night} & {\n                background-image: url(@src-night);\n            }\n        }\n    }\n}\n\n// mixin: 生成背景颜色\n.wuji-background(@code: undefined) {\n    .wuji-background-color(@code);\n}\n\n// mixin: 生成描边颜色\n.wuji-border-color(@code: undefined, @position: around) {\n    @color-default: getColor(@code);\n    @prop: if(@position = around, e('border-color'), e('border-@{position}-color'));\n    @{prop}: @color-default;\n\n    & when (@multi-mode = true) and (@dark-mode = true) {\n        @color-dark: getColor(@code, dark);\n\n        & when (@force-dark-output = true), not (@color-dark = 'null') and not (@color-dark = @color-default) {\n            @{selector-dark} & {\n                @{prop}: @color-dark;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and (@night-mode = true) {\n        @color-night: getColor(@code, night);\n\n        & when not (@color-night = 'null') and not (@color-night = @color-default) {\n            @{selector-night} & {\n                @{prop}: @color-night;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and not (@selector-default = '') {\n        @{selector-default} & {\n            @{prop}: @color-default;\n        }\n    }\n}\n\n// mixin: 生成描边颜色\n// 当第一个参数是多值