exports.push([module.i, "/**\n * @file 组件样式 无极-弹窗带表格\n * @author yangmei03 <yangmei03@baidu.com>\n */\n/**\n * @file 无极元素库 index.less\n * @author wuji.baidu-int.com\n */\n.w-popup-options-answer .w-popup-options-items {\n  margin-left: 17px;\n  margin-right: 17px;\n}\n.w-popup-options-answer .w-popup-options-items.selected,\n.w-popup-options-list .w-popup-options-items.selected {\n  font-size: 16px;\n  font-weight: 400;\n  line-height: 1;\n  color: rgba(51, 136, 255, 1);\n}\n.w-popup-options-answer .w-popup-options-items .options-left,\n.w-popup-options-list .w-popup-options-items .options-left {\n  -webkit-align-items: center;\n          align-items: center;\n}\n.w-popup-options-iconList .w-popup-options-items .options-left {\n  -webkit-align-items: start;\n          align-items: start;\n}\n.w-popup-options .w-popup-options-items {\n  display: -webkit-flex;\n  display: flex;\n  -webkit-justify-content: space-between;\n          justify-content: space-between;\n  -webkit-align-items: center;\n          align-items: center;\n  padding-left: 17px;\n  padding-right: 17px;\n  padding-top: 21px;\n  padding-bottom: 21px;\n  font-size: 16px;\n  font-weight: 400;\n  line-height: 1;\n  color: rgba(0, 0, 0, 1);\n  border-bottom: 1px solid #000;\n}\n.w-popup-options .w-popup-options-items .options-selected {\n  display: none;\n}\n.w-popup-options .w-popup-options-items,\n.w-popup-options .w-popup-options-items::after {\n  border-color: #eee;\n}\n.w-popup-options .w-popup-options-items.selected .options-selected {\n  display: block;\n  width: 0.16rem;\n  height: 0.16rem;\n}\n.w-popup-options .w-popup-options-items .options-left {\n  display: -webkit-flex;\n  display: flex;\n}\n.w-popup-options .w-popup-options-items .options-left .options-icon {\n  width: 0.16rem;\n  height: 0.16rem;\n  margin-right: 8px;\n  margin-top: 3px;\n}\n.w-popup-options .w-popup-options-items .options-avatar {\n  border-radius: 50%;\n  background-size: contain;\n  display: inline-block;\n  margin-right: 10px;\n  width: 0.32rem;\n  height: 0.32rem;\n}\n.w-popup-options .w-popup-options-items .options-text-title {\n  display: -webkit-flex;\n  display: flex;\n  -webkit-flex-direction: column;\n          flex-direction: column;\n}\n.w-popup-options .w-popup-options-items .options-text-title .options-subtitle {\n  font-size: 14px;\n  font-weight: 400;\n  line-height: 1;\n  color: rgba(153, 153, 153, 1);\n  margin-top: 9px;\n}\n.w-popup-options .options-button {\n  padding-left: 17px;\n  padding-right: 17px;\n  padding-top: 21px;\n  padding-bottom: 21px;\n}\n", "",{"version":3,"sources":["list.less","/Users/liaohuanyu/projects/baidu-work/baidu/feed3/multi-pages/node_modules/@baidu/wuji-san/es/wuji-popup/style/list.less","/Users/liaohuanyu/projects/baidu-work/baidu/feed3/multi-pages/node_modules/@baidu/wuji-uikit/src/spacing/mixins.less","/Users/liaohuanyu/projects/baidu-work/baidu/feed3/multi-pages/node_modules/@baidu/wuji-uikit/src/font/mixins.less","/Users/liaohuanyu/projects/baidu-work/baidu/feed3/multi-pages/node_modules/@baidu/wuji-uikit/src/color/mixins.less","/Users/liaohuanyu/projects/baidu-work/baidu/feed3/multi-pages/node_modules/@baidu/wuji-uikit/src/text/mixins.less","/Users/liaohuanyu/projects/baidu-work/baidu/feed3/multi-pages/node_modules/@baidu/wuji-uikit/src/line/mixins.less"],"names":[],"mappings":"AAAA;;;EAGE;AACF;;;EAGE;ACEE;ECqCA,iBAAA;EACA,kBAAA;AFpCJ;ACII;;EEIA,eAAA;EAZA,gBAAA;EAqCA,cAAA;ECuFA,4BAAA;AJjHJ;ACHI;;EAMQ,2BAAA;UAAA,mBAAA;ADCZ;ACGI;EAEQ,0BAAA;UAAA,kBAAA;ADFZ;AKzBC;EJ+BO,qBAAA;EAAA,aAAA;EACA,sCAAA;UAAA,8BAAA;EACA,2BAAA;UAAA,mBAAA;EC8DJ,kBAAA;EACA,mBAAA;EAjCA,iBAAA;EAgBA,oBAAA;EC5DA,eAAA;EAZA,gBAAA;EAqCA,cAAA;ECuFA,uBAAA;EEjEI,6BAAA;AN3BR;AKvCC;EJwCW,aAAA;ADEZ;ACEQ;;EAEI,kBAAA;ADAZ;ACGQ;EAEQ,cAAA;EACA,cAAA;EACA,eAAA;ADFhB;AKnDC;EJ0DW,qBAAA;EAAA,aAAA;ADJZ;AKtDC;EJ6De,cAAA;EACA,eAAA;ECxCZ,iBAAA;EARA,eAAA;AF8CJ;AK5DC;EJqEW,kBAAA;EACA,wBAAA;EACA,qBAAA;ECjDR,kBAAA;EDoDQ,cAAA;EACA,eAAA;ADPZ;AKpEC;EJ+EW,qBAAA;EAAA,aAAA;EACA,8BAAA;UAAA,sBAAA;ADRZ;AKxEC;EFmBG,eAAA;EAZA,gBAAA;EAqCA,cAAA;ECuFA,6BAAA;EFrHA,eAAA;AFiEJ;AK/EC;EH+FG,kBAAA;EACA,mBAAA;EAjCA,iBAAA;EAgBA,oBAAA;AFMJ","file":"list.less","sourcesContent":["/**\n * @file 组件样式 无极-弹窗带表格\n * @author yangmei03 <yangmei03@baidu.com>\n */\n/**\n * @file 无极元素库 index.less\n * @author wuji.baidu-int.com\n */\n.w-popup-options-answer .w-popup-options-items {\n  margin-left: 17px;\n  margin-right: 17px;\n}\n.w-popup-options-answer .w-popup-options-items.selected,\n.w-popup-options-list .w-popup-options-items.selected {\n  font-size: 16px;\n  font-weight: 400;\n  line-height: 1;\n  color: rgba(51, 136, 255, 1);\n}\n.w-popup-options-answer .w-popup-options-items .options-left,\n.w-popup-options-list .w-popup-options-items .options-left {\n  align-items: center;\n}\n.w-popup-options-iconList .w-popup-options-items .options-left {\n  align-items: start;\n}\n.w-popup-options .w-popup-options-items {\n  display: flex;\n  justify-content: space-between;\n  align-items: center;\n  padding-left: 17px;\n  padding-right: 17px;\n  padding-top: 21px;\n  padding-bottom: 21px;\n  font-size: 16px;\n  font-weight: 400;\n  line-height: 1;\n  color: rgba(0, 0, 0, 1);\n  border-bottom: 1px solid #000;\n}\n.w-popup-options .w-popup-options-items .options-selected {\n  display: none;\n}\n.w-popup-options .w-popup-options-items,\n.w-popup-options .w-popup-options-items::after {\n  border-color: #eee;\n}\n.w-popup-options .w-popup-options-items.selected .options-selected {\n  display: block;\n  width: 48pr;\n  height: 48pr;\n}\n.w-popup-options .w-popup-options-items .options-left {\n  display: flex;\n}\n.w-popup-options .w-popup-options-items .options-left .options-icon {\n  width: 48pr;\n  height: 48pr;\n  margin-right: 8px;\n  margin-top: 3px;\n}\n.w-popup-options .w-popup-options-items .options-avatar {\n  border-radius: 50%;\n  background-size: contain;\n  display: inline-block;\n  margin-right: 10px;\n  width: 96pr;\n  height: 96pr;\n}\n.w-popup-options .w-popup-options-items .options-text-title {\n  display: flex;\n  flex-direction: column;\n}\n.w-popup-options .w-popup-options-items .options-text-title .options-subtitle {\n  font-size: 14px;\n  font-weight: 400;\n  line-height: 1;\n  color: rgba(153, 153, 153, 1);\n  margin-top: 9px;\n}\n.w-popup-options .options-button {\n  padding-left: 17px;\n  padding-right: 17px;\n  padding-top: 21px;\n  padding-bottom: 21px;\n}\n","/**\n * @file 组件样式 无极-弹窗带表格\n * @author yangmei03 <yangmei03@baidu.com>\n */\n@import '@baidu/wuji-uikit/src/index.less';\n\n@prefix-cls: w-popup-options;\n\n.@{prefix-cls} {\n    &-answer {\n        .@{prefix-cls}-items {\n            .wuji-mx(M_W_X010);\n        }\n    }\n\n    &-answer,\n    &-list {\n        .@{prefix-cls}-items.selected {\n            .wuji-text-one-line(Txt_X046);\n        }\n        .@{prefix-cls}-items .options-left {\n            align-items: center;\n        }\n    }\n\n    &-iconList {\n        .@{prefix-cls}-items .options-left {\n            align-items: start;\n        }\n    }\n    .@{prefix-cls}-items {\n        display: flex;\n        justify-content: space-between;\n        align-items: center;\n        .wuji-px(M_W_X010);\n        .wuji-pt(M_H_X007);\n        .wuji-pb(M_H_X007);\n        .wuji-text-one-line(Txt_X017);\n\n        .options-selected {\n            display: none;\n        }\n        .wuji-line(L_X03, bottom);\n\n        &,\n        &::after {\n            border-color: #eee; // mark\n        }\n\n        &.selected {\n            .options-selected {\n                display: block;\n                width: 48pr;\n                height: 48pr;\n            }\n        }\n\n        .options-left {\n            display: flex;\n\n            .options-icon {\n                width: 48pr;\n                height: 48pr;\n                .wuji-mr(M_W_X005);\n                .wuji-mt(M_W_X001);\n            }\n        }\n\n        .options-avatar {\n            border-radius: 50%;\n            background-size: contain;\n            display: inline-block;\n            .wuji-mr(M_W_X007);\n            // todo 头像为1N\n            width: 96pr;\n            height: 96pr;\n        }\n\n        .options-text-title {\n            display: flex;\n            flex-direction: column;\n\n            .options-subtitle {\n                .wuji-text-one-line(Txt_X011);\n                .wuji-mt(M_H_X003);\n            }\n        }\n    }\n\n    .options-button {\n        .wuji-px(M_W_X010);\n        .wuji-pt(M_H_X007);\n        .wuji-pb(M_H_X007);\n    }\n}\n","/**\n * @file spacing mixins\n * @author baozhixin <baozhixin@baidu.com>\n *\n * wuji-mx/wuji-my/wuji-px/wuji-py 没有先赋值一个变量的原因参考 plugin-less 文件 TIPS 说明\n */\n\n// 外边距\n.wuji-margin(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 上边距\n.wuji-margin-top(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-top: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-mt(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-margin-top(@code, @dpr, @unit);\n}\n\n// 右边距\n.wuji-margin-right(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-mr(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-margin-right(@code, @dpr, @unit);\n}\n\n// 下边距\n.wuji-margin-bottom(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-mb(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-margin-bottom(@code, @dpr, @unit);\n}\n\n// 左边距\n.wuji-margin-left(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-left: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-ml(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-margin-left(@code, @dpr, @unit);\n}\n\n// 左右边距\n.wuji-mx(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-left: addUnit(getSpacing(@code), @dpr, @unit);\n    margin-right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 上下边距\n.wuji-my(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    margin-top: addUnit(getSpacing(@code), @dpr, @unit);\n    margin-bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 内填充\n.wuji-padding(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 上填充\n.wuji-padding-top(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-top: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-pt(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-padding-top(@code, @dpr, @unit);\n}\n\n// 右填充\n.wuji-padding-right(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-pr(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-padding-right(@code, @dpr, @unit);\n}\n\n// 下填充\n.wuji-padding-bottom(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-pb(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-padding-bottom(@code, @dpr, @unit);\n}\n\n// 左填充\n.wuji-padding-left(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-left: addUnit(getSpacing(@code), @dpr, @unit);\n}\n.wuji-pl(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-padding-left(@code, @dpr, @unit);\n}\n\n// 左右填充\n.wuji-px(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-left: addUnit(getSpacing(@code), @dpr, @unit);\n    padding-right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 上下填充\n.wuji-py(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    padding-top: addUnit(getSpacing(@code), @dpr, @unit);\n    padding-bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 绝对/相对定位-上偏移\n.wuji-top(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    top: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 绝对/相对定位-右偏移\n.wuji-right(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    right: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 绝对/相对定位-下偏移\n.wuji-bottom(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    bottom: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 绝对/相对定位-左偏移\n.wuji-left(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    left: addUnit(getSpacing(@code), @dpr, @unit);\n}\n\n// 水平和垂直方向平移\n.wuji-translate(@code-x: undefined, @code-y: undefined, @dpr: @dpr, @unit: @unit) {\n    transform: translate(addUnit(getSpacing(@code-x), @dpr, @unit), addUnit(getSpacing(@code-y), @dpr, @unit));\n}\n\n// 水平方向平移\n.wuji-translate-x(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    transform: translateX(addUnit(getSpacing(@code), @dpr, @unit));\n}\n.wuji-trans-x(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-translate-x(@code, @dpr, @unit);\n}\n\n// 垂直方向平移\n.wuji-translate-y(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    transform: translateY(addUnit(getSpacing(@code), @dpr, @unit));\n}\n.wuji-trans-y(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    .wuji-translate-y(@code, @dpr, @unit);\n}\n","/**\n * @file font mixins\n * @author Sheeta(wuhayao@gmail.com)\n */\n\n// 字形\n.wuji-font-weight(@code: undefined) when (default()) {\n    font-weight: getFontWeight(@code);\n\n    & when (getFontWeight(@code) = 600) and not (@fake-font-weight-600 = false) {\n        @{selector-android} & {\n            font-weight: unset;\n            -webkit-text-stroke-width: 1.2pr;\n        }\n    }\n}\n\n// 字号\n.wuji-font-size(@code: undefined, @dpr: @dpr, @unit: @unit) {\n    font-size: addUnit(getFontSize(@code), @dpr, @unit);\n}\n\n// 行高=字号编码+间距编码\n.wuji-line-height(@font-size, @line-spacing, @dpr: @dpr, @unit: @unit) {\n    line-height: addUnit(getFontSize(@font-size) + getSpacing(@line-spacing), @dpr, @unit);\n}\n\n// 使用间距设置字体行高，适用于多行文本\n.wuji-font(@font-size, @line-spacing, @font-weight: F_X01, @dpr: @dpr, @unit: @unit) {\n    .wuji-font-size(@font-size, @dpr, @unit);\n    .wuji-font-weight(@font-weight);\n    .wuji-line-height(@font-size, @line-spacing, @dpr, @unit);\n}\n\n// .wuji-font-no-out-spacing 缩写，即文本第一行顶部与容器顶部，最后一行底部与容器底部没有间距，通过设置负 margin 得到\n.wuji-font-nos(@font-size, @line-spacing, @font-weight: F_X01, @dpr: @dpr, @unit: @unit) {\n    .wuji-font(@font-size, @line-spacing, @font-weight, @dpr, @unit);\n    .wuji-my(@line-spacing, @dpr, @unit * -0.5);\n}\n\n// 使用倍数设置字体行高，适用于单行文本\n.wuji-font-one-line(@font-size, @line-height: 1, @font-weight: F_X01, @dpr: @dpr, @unit: @unit) {\n    .wuji-font-size(@font-size, @dpr, @unit);\n    .wuji-font-weight(@font-weight);\n    line-height: @line-height;\n}\n","/**\n * @file color mixins\n * @author wuji.baidu-int.com\n *\n * 区别于color、background-color、border-color等受全局dark-mode和night-mode变量影响。\n * fill属性可以定义局部变量night-mode，这在关闭夜间模式情况下，可以单独保留svg填充颜色fill属性。\n * 究其原因：百度APP安卓夜间模式下，基本的颜色属性不能通过css定义生效，svg的颜色属性例外。建议自行测试验证和理解。\n */\n\n// TODO: 使用css变量\n// .use-cssvar() {}\n\n// mixin: 生成背景颜色\n.wuji-background-color(@code: undefined) {\n    @color-default: getColor(@code);\n    background-color: @color-default;\n\n    & when (@multi-mode = true) and (@dark-mode = true) {\n        @color-dark: getColor(@code, dark);\n\n        & when (@force-dark-output = true), not (@color-dark = 'null') and not (@color-dark = @color-default) {\n            @{selector-dark} & {\n                background-color: @color-dark;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and (@night-mode = true) {\n        @color-night: getColor(@code, night);\n\n        & when not (@color-night = 'null') and not (@color-night = @color-default) {\n            @{selector-night} & {\n                background-color: @color-night;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and not (@selector-default = '') {\n        @{selector-default} & {\n            background-color: @color-default;\n        }\n    }\n}\n\n// mixin: 添加区分模式的背景图片(可置于全局mixin中)\n.wuji-background-image(@src: null, @src-dark: null, @src-night: null) {\n    & when not (@src = null) {\n        background-image: url(@src);\n    }\n    & when (@multi-mode = true) {\n        & when not (@src-dark = null) and (@dark-mode = true) and not (@src = @src-dark) {\n            @{selector-dark} & {\n                background-image: url(@src-dark);\n            }\n        }\n        & when not (@src-night = null) and (@night-mode = true) and not (@src = @src-night) {\n            @{selector-night} & {\n                background-image: url(@src-night);\n            }\n        }\n    }\n}\n\n// mixin: 生成背景颜色\n.wuji-background(@code: undefined) {\n    .wuji-background-color(@code);\n}\n\n// mixin: 生成描边颜色\n.wuji-border-color(@code: undefined, @position: around) {\n    @color-default: getColor(@code);\n    @prop: if(@position = around, e('border-color'), e('border-@{position}-color'));\n    @{prop}: @color-default;\n\n    & when (@multi-mode = true) and (@dark-mode = true) {\n        @color-dark: getColor(@code, dark);\n\n        & when (@force-dark-output = true), not (@color-dark = 'null') and not (@color-dark = @color-default) {\n            @{selector-dark} & {\n                @{prop}: @color-dark;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and (@night-mode = true) {\n        @color-night: getColor(@code, night);\n\n        & when not (@color-night = 'null') and not (@color-night = @color-default) {\n            @{selector-night} & {\n                @{prop}: @color-night;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and not (@selector-default = '') {\n        @{selector-default} & {\n            @{prop}: @color-default;\n        }\n    }\n}\n\n// mixin: 生成描边颜色\n// 当第一个参数是多值情况且固定顺序 <line-width> <line-style> <color> 时\n// 会调用line/mixin.less中的wuji-border方法，参数示例：1px solid red\n.wuji-border(@code: undefined, @position: around) when (length(@code) = 1) {\n    .wuji-border-color(@code, @position);\n}\n\n// mixn: 生成上描边颜色\n.wuji-border-top-color(@code: undefined) {\n    .wuji-border-color(@code, top);\n}\n\n// mixn: 生成下描边颜色\n.wuji-border-bottom-color(@code: undefined) {\n    .wuji-border-color(@code, bottom);\n}\n\n// mixn: 生成左描边颜色\n.wuji-border-left-color(@code: undefined) {\n    .wuji-border-color(@code, left);\n}\n\n// mixn: 生成右描边颜色\n.wuji-border-right-color(@code: undefined) {\n    .wuji-border-color(@code, right);\n}\n\n// mixin: 生成文字颜色\n.wuji-color(@code: undefined) {\n    @color-default: getColor(@code);\n    color: @color-default;\n\n    & when (@multi-mode = true) and (@dark-mode = true) {\n        @color-dark: getColor(@code, dark);\n\n        & when (@force-dark-output = true), not (@color-dark = 'null') and not (@color-dark = @color-default) {\n            @{selector-dark} & {\n                color: @color-dark;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and (@night-mode = true) {\n        @color-night: getColor(@code, night);\n\n        & when not (@color-night = 'null') and not (@color-night = @color-default) {\n            @{selector-night} & {\n                color: @color-night;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and not (@selector-default = '') {\n        @{selector-default} & {\n            color: @color-default;\n        }\n    }\n}\n\n// mixin: 生成svg填充颜色\n.wuji-fill(@code: undefined, @night-mode: true) {\n    @color-default: getColor(@code);\n    fill: @color-default;\n\n    & when (@multi-mode = true) and (@dark-mode = true) {\n        @color-dark: getColor(@code, dark);\n\n        & when (@force-dark-output = true), not (@color-dark = 'null') and not (@color-dark = @color-default) {\n            @{selector-dark} & {\n                fill: @color-dark;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and (@night-mode = true) {\n        @color-night: getColor(@code, night);\n\n        & when not (@color-night = 'null') and not (@color-night = @color-default) {\n            @{selector-night} & {\n                fill: @color-night;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and not (@selector-default = '') {\n        @{selector-default} & {\n            fill: @color-default;\n        }\n    }\n}\n\n// mixin: 生成光标颜色\n.wuji-caret(@code: undefined) {\n    @color-default: getColor(@code);\n    caret-color: @color-default;\n\n    & when (@multi-mode = true) and (@dark-mode = true) {\n        @color-dark: getColor(@code, dark);\n\n        & when (@force-dark-output = true), not (@color-dark = 'null') and not (@color-dark = @color-default) {\n            @{selector-dark} & {\n                caret-color: @color-dark;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and (@night-mode = true) {\n        @color-night: getColor(@code, night);\n\n        & when not (@color-night = 'null') and not (@color-night = @color-default) {\n            @{selector-night} & {\n                caret-color: @color-night;\n            }\n        }\n    }\n\n    & when (@multi-mode = true) and not (@selector-default = '') {\n        @{selector-default} & {\n            caret-color: @color-default;\n        }\n    }\n}\n\n// mixin: 生成透明度\n.wuji-opacity(@code: undefined) {\n    opacity: getOpacity(@code);\n}\n\n// mixin: 根元素注入默认color、background-color, 默认根元素html\n.wuji-root(\n    @color: CAM_X791, // GC1\n    @background: CAM_X392, // GC9\n    @selector-root: @selector-root,\n    @selector-dark: @selector-dark,\n    @selector-night: @selector-night\n) {\n    // 如果选择器参数是字符串类型，需要escape\n    @rule1: if(isstring(@selector-root), e(@selector-root), @selector-root);\n    @rule2: if(isstring(@selector-dark), e(@selector-dark), @selector-dark);\n    @rule3: if(isstring(@selector-night), e(@selector-night), @selector-night);\n\n    @{rule1} {\n        color: getColor(@color);\n        background-color: getColor(@background);\n\n        & when (@multi-mode = true) and (@dark-mode = true) {\n            &@{rule2} {\n                color: getColor(@color, Dark);\n                background-color: getColor(@background, Dark);\n            }\n        }\n\n        & when (@multi-mode = true) and (@night-mode = true) {\n            &@{rule3} {\n                color: getColor(@color, Night);\n                background-color: getColor(@background, Night);\n            }\n        }\n    }\n}\n","/**\n * @file text mixins\n * @author Sheeta(wuhayao@gmail.com)\n */\n\n.wuji-text(@code, @line-spacing) {\n    @t-code: #Txt_T[@@code];\n    @f-code: #Txt_F[@@code];\n    @cam-code: #Txt_CAM[@@code];\n\n    .wuji-font(@t-code, @line-spacing, @f-code);\n    .wuji-color(@cam-code);\n}\n\n.wuji-text-one-line(@code, @line-height: 1) {\n    @t-code: #Txt_T[@@code];\n    @f-code: #Txt_F[@@code];\n    @cam-code: #Txt_CAM[@@code];\n\n    .wuji-font-one-line(@t-code, @line-height: @line-height, @f-code);\n    .wuji-color(@cam-code);\n}\n","/**\n * @file line mixins\n * @author Sheeta(wuhayao@gmail.com)\n */\n\n// 设置线条背景颜色\n.set-background-color(@color) {\n    & when (iscolor(@color) = true) {\n        background-color: @color;\n    }\n    & when (iscolor(@color) = false) {\n        .wuji-background(@color);\n    }\n}\n\n// hack: 安卓夜间模式1px看不清，通过在伪元素:after上定义rgba颜色后再微调透明度\n// .hairline-nightmode() {\n//     @{selector-night} &:after {\n//         border-color: rgba(0, 0, 0, .9);\n//         background-color: rgba(0, 0, 0, .01);\n//         opacity: .3;\n//     }\n// }\n\n// 单独设置边框宽度属性\n.wuji-border-width(@code, @position: around) {\n    // 确定边框属性\n    @prop: if(@position = around, e('border-width'), e('border-@{position}-width'));\n    @{prop}: addUnit(getLine(@code), @dpr, @unit);\n}\n// 单独设置上边框宽度↑\n.wuji-border-top-width(@code) {\n    .wuji-border-width(@code, top);\n}\n// 单独设置右边框宽度→\n.wuji-border-right-width(@code) {\n    .wuji-border-width(@code, right);\n}\n// 单独设置下边框宽度↓\n.wuji-border-bottom-width(@code) {\n    .wuji-border-width(@code, bottom);\n}\n// 单独设置左边框宽度←\n.wuji-border-left-width(@code) {\n    .wuji-border-width(@code, left);\n}\n\n// 设置边框样式，参数说明：\n// @params: 第一项可以是数值或线条编码，第三项可以是颜色值或CAM编码\n// @position: around/top/right/bottom/left\n.wuji-border(@params, @position: around) when (length(@params) = 3) {\n    @border-prop: if(@position = around, e('border'), e('border-@{position}'));\n    // 宽度不是数字时按编码取值\n    @tmp-width: extract(@params, 1);\n    // @width: if(isnumber(@tmp-width), @tmp-width, addUnit(getLine(@tmp-width), @dpr, @unit));\n    @style: extract(@params, 2);\n    @color: extract(@params, 3);\n\n    // eg: 1px solid red\n    & when (iscolor(@color)) and (isnumber(@tmp-width)) {\n        @{border-prop}: @tmp-width @style @color;\n    }\n\n    // eg: L_X03 dashed red\n    & when (iscolor(@color)) and not (isnumber(@tmp-width)) {\n        @width: addUnit(getLine(@tmp-width), @dpr, @unit);\n        @{border-prop}: @width @style @color;\n    }\n\n    // eg: 1px solid CAM_X001\n    & when not (iscolor(@color)) and (isnumber(@tmp-width)) {\n        @{border-prop}: @tmp-width @style;\n        .wuji-border-color(@color, @position);\n    }\n\n    // eg: L_X03 solid CAM_X001\n    & when not (iscolor(@color)) and not (isnumber(@tmp-width)) {\n        @width: addUnit(getLine(@tmp-width), @dpr, @unit);\n        @{border-prop}: @width @style;\n        .wuji-border-color(@color, @position);\n    }\n}\n// 单独设置上边框样式↑\n.wuji-border-top(@params) {\n    .wuji-border(@params, top);\n}\n// 单独设置右边框样式→\n.wuji-border-right(@params) {\n    .wuji-border(@params, right);\n}\n// 单独设置下边框样式↓\n.wuji-border-bottom(@params) {\n    .wuji-border(@params, bottom);\n}\n// 单独设置左边框样式←\n.wuji-border-left(@params) {\n    .wuji-border(@params, left);\n}\n\n// 以容器元素border属性实现线条时的样式\n// @code: L_X*\n// @position: around/top/right/bottom/left\n// @color: color/CAM_X*\n// @radius: J_X*\n.wuji-line(@code: L_X03, @position: around, @color: #000, @radius: false) {\n    // 判断是否需要添加伪元素\n    @pseudo: if(getLine(@code) < 3, after, false);\n\n    // 线条宽度不小于3时添加边框样式\n    & when (@pseudo = false) {\n        .wuji-border(@code solid @color, @position);\n    }\n\n    // 线条宽度小于3时添加伪元素\n    & when (@pseudo = after) {\n        position: relative;\n        overflow: visible;\n\n        &:after {\n            content: '';\n            position: absolute;\n            left: 0;\n            top: 0;\n            pointer-events: none;\n            transform-origin: 0 0;\n            .wuji-border(if(@code = L_X01, 1px, 2px) solid @color, @position);\n        }\n\n        .set-media(1.5, {\n            &:after {\n                width: 150%;\n                height: 150%;\n                // less4以下\n                // transform: scale(1 / 1.5);\n                // less4以上，除运算要额外使用括号括起来\n                // transform: scale((1 / 1.5));\n                transform: scale(0.66666667);\n            }\n        });\n\n        .set-media(2, {\n            &:after {\n                width: 200%;\n                height: 200%;\n                transform: scale(0.5);\n            }\n        });\n\n        .set-media(3, {\n            &:after {\n                width: 300%;\n                height: 300%;\n                transform: scale(0.33333333);\n            }\n        });\n    }\n\n    // 按圆角编码添加圆角\n    & when not (@radius = false) {\n        .wuji-border-radius(@radius, around, @pseudo);\n    }\n}\n\n// 以元素宽高实现线条时的样式\n// @code: L_X*\n// @color: color/CAM_X*\n// @direction: horizontal/vertical\n// @width: horizontal时有效\n// @height: vertical时有效\n.wuji-divider(@code: L_X03, @color: transparent, @direction: horizontal, @width: auto, @height: auto) {\n    // 判断是否需要添加伪元素\n    @pseudo: if(getLine(@code) < 3, after, false);\n    // 线宽属性\n    @line-prop: if(@direction = horizontal, height, width);\n    // 线长属性\n    @size-prop: if(@direction = horizontal, width, height);\n    // 设置线长\n    @{size-prop}: if(@size-prop = width, @width, @height);\n\n    // 线条宽度不小于3时添加边框样式\n    & when (@pseudo = false) {\n        // 设置线宽\n        @{line-prop}: addUnit(getLine(@code), @dpr, @unit);\n        // 添加背景色\n        .set-background-color(@color);\n    }\n\n    // 线条宽度小于3时添加伪元素，本身占宽度1px\n    & when (@pseudo = after) {\n        position: relative;\n        background-color: transparent;\n        @{line-prop}: 1px;\n\n        // 水平方向按Y轴缩放，垂直方向按X轴缩放\n        @scale: if(@direction = horizontal, scaleY, scaleX);\n\n        &:after {\n            content: '';\n            position: absolute;\n            left: 0;\n            top: 0;\n            transform-origin: 0 0;\n            @{line-prop}: if(@code = L_X01, 1px, 2px);\n            @{size-prop}: 100%;\n            .set-background-color(@color);\n        }\n\n        .set-media(1.5, {\n            &:after {\n                transform: e(%('@{scale}(%d)', 0.66666667));\n            }\n        });\n\n        .set-media(2, {\n            &:after {\n                transform: e(%('@{scale}(%d)', 0.5));\n            }\n        });\n\n        .set-media(3, {\n            &:after {\n                transform: e(%('@{scale}(%d)', 0.33333333));\n            }\n        });\n    }\n}\n"]}]);


